interface IProps {
    fetchUsers(): any
}


const AllUsers = (props:IProps) => {

    const FetchUsers = () => {
        props.fetchUsers()
        console.log(props)
    }

    return (
        <div>
            <button onClick={() => FetchUsers}>Click Me</button>
        </div>
    )
}

const mapStateToProps = (state: any) => {
    return [...state]
}


export default connect(mapStateToProps, {fetchUsers})(AllUsers)
